  /* user code: */
  /**
   * Counts the number of line breaks after the previous text, typically paragraph.
   * White spaces as well as leading asterisks aren't considered as text, so, they don't reset the counter.
   * It allows implementing markdown spec in a more convenient way.
   * For instance, indented code blocks require two consecutive line breaks after paragraphs.
   */
  private var consecutiveLineBreakCount: Int = 0

  /**
    * Stores the symbol that started the current code block (tilda or backtick).
    */
  private var codeFenceChar = 0.toChar()

  /**
    * Counts the length of the [codeFenceChar] string that started the current code block.
    */
  private var codeFenceLength = -1;

  private var lastBlockType: BlockType? = null

  private enum class BlockType {
      Paragraph,
      Code,
  }

  /**
   * It should be used by default instead of [yybegin] except in cases where manual handling of [consecutiveLineBreakCount] is needed.
   * For instance, although the leading asterisk switches to the [CONTENTS_BEGINNING] state, it shouldn't affect [consecutiveLineBreakCount]
   * because it's a special char that's invisible from the point of view of the plain Markdown parser.
   */
  private fun yybeginAndUpdate(newState: Int) {
    consecutiveLineBreakCount = if (newState == LINE_BEGINNING || newState == CODE_BLOCK_LINE_BEGINNING) consecutiveLineBreakCount + 1 else 0
    yybegin(newState)
  }

  private val isLastToken: Boolean
    get() = zzMarkedPos == zzBuffer.length

  private fun countRepeating(c: Char): Int {
      var current = zzStartRead
      while (zzBuffer[current] == c && current < zzMarkedPos) {
          ++current
      }
      return current - zzStartRead
  }



  /** Returns the maximum size of the scanner buffer, which limits the size of tokens. */
  private fun zzMaxBufferLen(): Int {
    return Int.MAX_VALUE
  }

  /**  Whether the scanner buffer can grow to accommodate a larger token. */
  private fun zzCanGrow(): Boolean {
    return true
  }


  override fun getTokenStart(): Int {
    return zzStartRead
  }

  override fun getTokenEnd(): Int {
    return getTokenStart() + yylength()
  }

  override fun reset(buffer: CharSequence, start: Int, end: Int, initialState: Int) {
    zzBuffer = buffer
    zzCurrentPos = start
    zzMarkedPos = start
    zzStartRead = start
    zzAtEOF  = false
    zzAtBOL = true
    zzEndRead = end
    yybegin(initialState)
  }

  /**
   * Refills the input buffer.
   *
   * @return      {@code false}, iff there was new input.
   */
  private fun zzRefill(): Boolean {
    return true
  }


  /**
   * Returns the current lexical state.
   */
  override fun yystate(): Int {
    return zzLexicalState
  }


  /**
   * Enters a new lexical state
   *
   * @param newState the new lexical state
   */
  override fun yybegin(newState: Int) {
    zzLexicalState = newState
  }


  /**
   * Returns the text matched by the current regular expression.
   */
  fun yytext(): CharSequence {
    return zzBuffer.subSequence(zzStartRead, zzMarkedPos)
  }


  /**
   * Returns the character at position {@code pos} from the
   * matched text.
   *
   * It is equivalent to yytext().charAt(pos), but faster
   *
   * @param pos the position of the character to fetch.
   *            A value from 0 to yylength()-1.
   *
   * @return the character at position pos
   */
  fun yycharat(position: Int): Char {
    return zzBuffer[zzStartRead + position] 
  }


  /**
   * Returns the length of the matched text region.
   */
  fun yylength(): Int {
    return zzMarkedPos - zzStartRead 
  }

  /**
   * Implementation of the `codePointAt` method of `java.lang.Character` for CharSequences
   *
   * @param index the index of the character for which to retrieve the code point.
   * @return the Unicode code point at the specified index.
   * @throws IndexOutOfBoundsException if the index is outside the bounds of the character sequence.
   */
  fun CharSequence.codePoint(index: Int): Int {
      val high = this[index]
      if (high.isHighSurrogate() && index + 1 < length) {
          val low = this[index + 1]
          if (low.isLowSurrogate()) {
              val codePoint: String = "$high$low"
              return codePoint.codePointAt(0)
          }
      }
      return high.code
  }

  /** Returns the character (Unicode code point) at the specified index. */
  internal fun String.codePointAt(index: Int): Int {
      val high = this[index]
      if (high.isHighSurrogate() && index + 1 < this.length) {
          val low = this[index + 1]
          if (low.isLowSurrogate()) {
              return Char.toCodePoint(high, low)
          }
      }
      return high.code
  }
  
  internal fun CharSequence.offsetByCodePoints(index: Int, codePointOffset: Int): Int {
    val length = this.length
    if (index < 0 || index > length) throw IndexOutOfBoundsException()

    var x = index
    if (codePointOffset >= 0) {
      var i: Int = 0
      
      while (x < length && i < codePointOffset) {
        if (this[x++].isHighSurrogate() && x < length && this[x].isLowSurrogate()) x++
        i++
      }
      
      if (i < codePointOffset) throw IndexOutOfBoundsException()
      
    } else {
      var i: Int = codePointOffset
      
      while (x > 0 && i < 0) {
        if (this[--x].isLowSurrogate() && x > 0 && this[x - 1].isHighSurrogate()) x--
        i++
      }
      
      if (i < 0) {
        throw IndexOutOfBoundsException()
      }
    }
    
    return x
  }

  internal fun Char.Companion.toCodePoint(high: Char, low: Char): Int =
      (((high - MIN_HIGH_SURROGATE) shl 10) or (low - MIN_LOW_SURROGATE)) + 0x10000

  private fun charCount(codePoint: Int): Int = if (codePoint < 0x10000) 1 else 2


  /**
   * Reports an error that occurred while scanning.
   *
   * In a wellformed scanner (no or only correct usage of
   * yypushback(int) and a match-all fallback rule) this method
   * will only be called with things that "Can't Possibly Happen".
   * If this method is called, something is seriously wrong
   * (e.g. a JFlex bug producing a faulty scanner etc.).
   *
   * Usual syntax/scanner level error handling should be done
   * in error fallback rules.
   *
   * @param   errorCode  the code of the errormessage to display
   */


  /**
   * Pushes the specified amount of characters back into the input stream.
   *
   * They will be read again by then next call of the scanning method
   *
   * @param number  the number of characters to be read again.
   *                This number must not be greater than yylength()!
   */
  public fun yypushback(number: Int)  {
    if ( number > yylength() )
      zzScanError(ZZ_PUSHBACK_2BIG)

    zzMarkedPos -= number
  }


  private fun zzScanError(errorCode: Int) {
    val message = try {
      ZZ_ERROR_MSG[errorCode]
    } catch (e: IndexOutOfBoundsException) {
      ZZ_ERROR_MSG[ZZ_UNKNOWN_ERROR]
    }

    throw Error(message)
  }
  /**
   * Translates raw input code points to DFA table row
   */
  private fun zzCMap(input: Int): Int {
    val offset: Int = input and 255
    return if(offset == input) ZZ_CMAP_BLOCKS[offset] else ZZ_CMAP_BLOCKS[ZZ_CMAP_TOP[input shr 8] or offset]
  }

  /**
   * Resumes scanning until the next regular expression is matched,
   * the end of input is encountered or an I/O-Error occurs.
   *
   * @return      the next token
   */
  override fun advance(): SyntaxElementType?
  {
    var zzInput: Int = 0 
    var zzAction: Int = 0 

    val zzTransL: IntArray = ZZ_TRANS
    val zzRowMapL: IntArray = ZZ_ROWMAP
    val zzAttrL: IntArray = ZZ_ATTRIBUTE

    while (true) {
      // cached fields:
      var zzCurrentPosL = 0
      var zzMarkedPosL: Int = zzMarkedPos 
      var zzEndReadL: Int = zzEndRead 
      var zzBufferL: CharSequence = zzBuffer 

      zzAction = -1

      zzCurrentPosL = zzMarkedPosL
      zzCurrentPos = zzMarkedPosL
      zzStartRead = zzMarkedPosL

      zzState = ZZ_LEXSTATE[zzLexicalState]

      // set up zzAction for empty match case:
      var zzAttributes: Int = zzAttrL[zzState]
      if ( (zzAttributes and 1) == 1 ) {
        zzAction = zzState
      }


      zzForAction@ while (true) {
          if (zzCurrentPosL < zzEndReadL) {
            zzInput = zzBufferL.codePoint(zzCurrentPosL)
            zzCurrentPosL += charCount(zzInput)
          }
          else if (zzAtEOF) {
            zzInput = YYEOF
            break@zzForAction
          }
          else {
            // store back cached positions
            zzCurrentPos  = zzCurrentPosL
            zzMarkedPos   = zzMarkedPosL
            val eof: Boolean = zzRefill()
            // get translated positions and possibly new buffer
            zzCurrentPosL  = zzCurrentPos
            zzMarkedPosL   = zzMarkedPos
            zzBufferL      = zzBuffer
            zzEndReadL     = zzEndRead
            if (eof) {
              zzInput = YYEOF
              break@zzForAction
            }
            else {
              zzInput = zzBufferL.codePoint(zzCurrentPosL)
              zzCurrentPosL += charCount(zzInput)
            }
          }
          val zzNext: Int = zzTransL[zzRowMapL[zzState] + zzCMap(zzInput)]
          if (zzNext == -1) break@zzForAction
          zzState = zzNext

          zzAttributes = zzAttrL[zzState]
          if ( (zzAttributes and 1) == 1 ) {
            zzAction = zzState
            zzMarkedPosL = zzCurrentPosL
            if ( (zzAttributes and 8) == 8 ) break@zzForAction
          }
      }

      // store back cached position
      zzMarkedPos = zzMarkedPosL

      if (zzInput == YYEOF && zzStartRead == zzCurrentPos) {
        zzAtEOF = true
        return null
      }
      else {
        when (if (zzAction < 0) zzAction else ZZ_ACTION[zzAction]) {
          1 -> {
            lastBlockType = BlockType.Paragraph
            return SyntaxTokenTypes.BAD_CHARACTER
            }
          // fall through
          24 -> break
          2 -> {
            lastBlockType = BlockType.Paragraph
            yybeginAndUpdate(CONTENTS)
            return KDocTokens.TEXT
            }
          // fall through
          25 -> break
          3 -> {
            return SyntaxTokenTypes.WHITE_SPACE
            }
          // fall through
          26 -> break
          4 -> {
            yybeginAndUpdate(LINE_BEGINNING)
            return SyntaxTokenTypes.WHITE_SPACE
            }
          // fall through
          27 -> break
          5 -> {
            lastBlockType = BlockType.Paragraph
            yybeginAndUpdate(CONTENTS)
            return KDocTokens.KDOC_LPAR
            }
          // fall through
          28 -> break
          6 -> {
            lastBlockType = BlockType.Paragraph
            yybeginAndUpdate(CONTENTS)
            return KDocTokens.KDOC_RPAR
            }
          // fall through
          29 -> break
          7 -> {
            yybegin(CONTENTS_BEGINNING)
            return KDocTokens.LEADING_ASTERISK
            }
          // fall through
          30 -> break
          8 -> {
            val state = yystate()

            if (
                // Recognize indented code blocks if only the line starts with an asterisk(s)
                state == CONTENTS_BEGINNING &&

                // If there are more than 4 spaces at the beginning of the line or a tab char, we are trying to recognize indented code block
                (zzMarkedPos - zzStartRead >= 4 || zzBuffer[zzStartRead] == '\t' || zzBuffer[zzMarkedPos - 1] == '\t') &&

                // If the last block type is paragraph, more than 1 consecutive line break is required
                (lastBlockType != BlockType.Paragraph || consecutiveLineBreakCount >= 2)
            ) {
                yybegin(INDENTED_CODE_BLOCK)
                lastBlockType = BlockType.Code
                return KDocTokens.CODE_BLOCK_TEXT
            }

            yybegin(if (yystate() == CONTENTS_BEGINNING) CONTENTS_BEGINNING else CONTENTS)

            return KDocTokens.TEXT  // internal white space
            }
          // fall through
          31 -> break
          9 -> {
            yybeginAndUpdate(CONTENTS)
            return KDocTokens.TEXT
            }
          // fall through
          32 -> break
          10 -> {
            consecutiveLineBreakCount++
            yybegin(LINE_BEGINNING)
            return SyntaxTokenTypes.WHITE_SPACE
            }
          // fall through
          33 -> break
          11 -> {
            yybeginAndUpdate(TAG_TEXT_BEGINNING)
            return KDocTokens.MARKDOWN_LINK
            }
          // fall through
          34 -> break
          12 -> {
            yybeginAndUpdate(if (yystate() == INDENTED_CODE_BLOCK) INDENTED_CODE_BLOCK else CODE_BLOCK)
            return KDocTokens.CODE_BLOCK_TEXT
            }
          // fall through
          35 -> break
          13 -> {
            return KDocTokens.CODE_BLOCK_TEXT
            }
          // fall through
          36 -> break
          14 -> {
            yybegin(if (yystate() == INDENTED_CODE_BLOCK) LINE_BEGINNING else CODE_BLOCK_LINE_BEGINNING)
            return SyntaxTokenTypes.WHITE_SPACE
            }
          // fall through
          37 -> break
          15 -> {
            yybegin(CODE_BLOCK_CONTENTS_BEGINNING)
            return KDocTokens.LEADING_ASTERISK
            }
          // fall through
          38 -> break
          16 -> {
            return if (isLastToken) KDocTokens.END else KDocTokens.TEXT
            }
          // fall through
          39 -> break
          17 -> {
            lastBlockType = BlockType.Paragraph
            yybeginAndUpdate(CONTENTS)
            return KDocTokens.MARKDOWN_ESCAPED_CHAR
            }
          // fall through
          40 -> break
          18 -> {
            lastBlockType = BlockType.Paragraph
            val tag = KDocKnownTag.findByTagName(zzBuffer.subSequence(zzStartRead, zzMarkedPos))
            yybeginAndUpdate(if (tag != null && tag.isReferenceRequired) TAG_BEGINNING else TAG_TEXT_BEGINNING)
            return KDocTokens.TAG_NAME
            }
          // fall through
          41 -> break
          19 -> {
            yybeginAndUpdate(CONTENTS_BEGINNING)
            return KDocTokens.START
            }
          // fall through
          42 -> break
          20 -> {
            lastBlockType = BlockType.Code
              codeFenceChar = zzBuffer[zzStartRead]
              codeFenceLength = countRepeating(codeFenceChar)
              yybeginAndUpdate(CODE_BLOCK_LINE_BEGINNING)
              return KDocTokens.TEXT
            }
          // fall through
          43 -> break
          21 -> {
            yybeginAndUpdate(CONTENTS)
            return KDocTokens.MARKDOWN_LINK
            }
          // fall through
          44 -> break
          22 -> {
            // lookahead expression with fixed lookahead length
            zzMarkedPos = zzBufferL.offsetByCodePoints(zzMarkedPos, -1)
            lastBlockType = BlockType.Paragraph
            yybeginAndUpdate(CONTENTS)
            return KDocTokens.MARKDOWN_LINK
            }
          // fall through
          45 -> break
          23 -> {
            // general lookahead, find correct zzMarkedPos
            { var zzFState = 9
              var zzFPos = zzStartRead
              if (zzFin == null) {
                zzFin = Bitset(zzBufferL.length+1)
              }
              val zzFinL = zzFin !!
              while (zzFState != -1 && zzFPos < zzMarkedPos) {
                zzFinL[zzFPos] = ((zzAttrL[zzFState] and 1) == 1)
                zzInput = zzBufferL.codePoint(zzFPos)
                zzFPos += charCount(zzInput)
                zzFState = zzTransL[ zzRowMapL[zzFState] + zzCMap(zzInput) ]
              }
              if (zzFState != -1) {
                zzFinL[zzFPos++] = ((zzAttrL[zzFState] and 1) == 1)
              }
              while (zzFPos <= zzMarkedPos) {
                zzFinL[zzFPos++] = false
              }

              zzFState = 10
              zzFPos = zzMarkedPos
              while (!zzFinL[zzFPos] || (zzAttrL[zzFState] and 1) != 1) {
                zzInput = Character.codePointBefore(zzBufferL, zzFPos)
                zzFPos -= charCount(zzInput)
                zzFState = zzTransL[ zzRowMapL[zzFState] + zzCMap(zzInput) ]
              }
              zzMarkedPos = zzFPos
            }
            val ch =  zzBuffer[zzStartRead]
              val length = countRepeating(ch)
              if (length == codeFenceLength && ch == codeFenceChar) {
                  // Code fence end
                  codeFenceChar = 0.toChar()
                  codeFenceLength = -1
                  yybeginAndUpdate(CONTENTS)
                  return KDocTokens.TEXT
              } else {
                  return KDocTokens.CODE_BLOCK_TEXT
              }
            }
          // fall through
          46 -> break
          else ->
            zzScanError(ZZ_NO_MATCH)
        }
      }
    }
    return null
  }


